import React,  {useState} from 'react';

const InputElement = () => {

    const [valueInput, setValueInput] = useState('');
    

    return (
        <div>
            <input
                onChange={(event) => {
                    setValueInput(event.target.value)
                }}
                placeholder="Enter Text"
            /><br />
            {valueInput}
        </div>
    );
};
export default InputElement;
